import React from 'react';

import './styles.css';

import usImg from '../../assets/us.jpg'

export default function Home() {
    return (
        <div className="home-container">
            <section className="home">
                <form>
                    <h1>Our Wedding is close</h1>

                    <button className="button" type="submit">Nossa história</button>
                    <button className="button" type="submit">A cerimônia</button>
                    <button className="button" type="submit">Lista de presentes</button>
                    <button className="button" type="submit">Confirme sua presença</button>
                    <button className="button" type="submit">Deixe um recado</button>
                </form>
            </section>

            <img src={usImg} alt="Us" width="500" />
        </div>
    );
}
